import AuthContext, { AuthContextProvider } from "context/AuthContext";
import Router from ".router";

function App() {
  return (
    <div className="app">
      <AuthContextProvider value={AuthContext}>
        <Router> </Router>
      </AuthContextProvider>
    </div>
  );
}

export default App;
